Why does using mongoose callback result in saving data twice?<p>I have been wondering why adding a callback to the mongoose findOneAndUpdate function results in saving the data twice to the DB?</p>

<pre><code>public async addPersonAsFavorite(userId: string, friendId: string) {
    if (!await this.isPersonAlreadyFriend(userId, friendId)) {
      const friendList = FriendsList.findOneAndUpdate(
        { _id: userId },
        { $push: { friendsList: friendId } },
        { upsert: true, new: true },
        (err, data) =&gt; {
         if (err) console.error(err);
         return data;
        }
      );
      return friendList;
    }}

