How to use MongoDB/Nodejs with Express to retrieve save data for a JavaScript-based game?<p>I'm trying to build a js browser game with Phaser and I've been learning Nodejs, Expressjs, and MongoDB along the way to serve it up. I'm new to Nodejs concepts like async and such. So far, I have my Node w/ Express server outputting an HTML file that calls up my game that's in a JS file. I've been able to communicate from my game to Nodejs using fetch and app.get calls to do things on Nodejs (e.g. send Twilio messages)</p>

<p>An example, just to make sure I'm getting the flow of this right:</p>

<p>in my static game.js~</p>

<pre><code>function sendSMS() {
    var url = 'http://localhost:6000/index';

    fetch(url).then(function(res) {
        console.log(res.text()); //just some confirmation message, outputs as a Promise
    }); 
}
</code></pre>

<p>And in my Node index.js~</p>

<pre><code>app.get('/index', function (req, res) {
    var text = 'YOU FLUSHED THE TOILET'; \\for the game

    const accountSid = process.env.TWILIO_ACCOUNT_SID;
    const authToken = process.env.TWILIO_AUTH_TOKEN;
    const client = require('twilio')(accountSid, authToken);

    client.messages
    .create({
        body: text,
        from: process.env.FROM_NUMBER,
        to: process.env.TO_NUMBER
    })
    .then(message =&gt; console.log(message.sid))
    .done();
    res.send("USER HAS BEEN NOTIFIED THAT THEY FLUSHED THE TOILET");
})
</code></pre>

<p>My html webpage with the reference to game.js is served from my Node index.js when a user connects via this method:</p>

<pre><code>app.get('/', function (req, res) {
    res.sendFile(path.join(__dirname,'index.html'));
});
</code></pre>

<p>That works great, but in my testing I noticed I couldn't send data from my Node server to the js client file, as Nodejs is async. </p>

<p>I want to store saved user data in a Mongo DB to be loaded on every startup for each specific user. Preferably I'd get this data into game.js to be manipulated.</p>

<p>So my question is, how should I get data from MongoDB into my game.js? Or is there a design flow that I should switch to to make this better?</p>

<p>(Also let me know if my file naming schema is dumb and/or how to improve)</p>

