How to group by an array field?<p>Let's say I have the following documents in a collection (<code>messages</code>):</p>

<pre><code>[
    {
        _id: 1,
        message: "...",
        participants: [1, 2],
        datetime_created: ...
    },
    {
        _id: 2,
        message: "...",
        participants: [4, 9],
        datetime_created: ...
    },
    {
        _id: 3,
        message: "...",
        participants: [2, 1],
        datetime_created: ...
    },     
    {
        _id: 4,
        message: "...",
        participants: [3, 6],
        datetime_created: ...
    }
]
</code></pre>

<p>Now I'm trying to get the last conversation message between participants 1 (currently logged in user) and 2. I tried writing aggregation pipeline like this:</p>

<pre><code>[
    {
        $match: {
            participants: {
                $in: [1] // logged in user
            }
        }
    },
    {
        $sort: {
            datetime_created: -1
        }
    },
    {
        $group: {
            _id: "$participants",
            last_message: {
                $first: "$$ROOT"
            }
        }
    }
]
</code></pre>

<p>It works but not completely. The problem is <code>$group</code> groups <code>participants</code> in such way that <code>[1, 2]</code> and <code>[2, 1]</code> are considered different elements because an array is an ordered collection of data. Is there a MongoDB-only way to disregard order in an array?</p>

<p>One solution would be to sort <code>participants</code> during the data insertion which would work but I'd rather have a solution which works on the database side only. </p>

