Can you use a mongodb table name in variable in a nodejs controller?<p>Lets say I got a mongodb table named "bookings", and another named "users" etc etc..</p>

<p>Would it be possible to call a function using a variable/parm as the table name?
Like this:</p>

<pre><code>let myData = getRecord("bookings", "ABCDE")
let myData = getRecord("users", "Torben")
</code></pre>

<p>Here is my suggestion to the code.</p>

<pre><code>var mongoose  = require('mongoose');

var getRecord = (tableName, recordID) =&gt; {
    return new Promise((resolve, reject) =&gt; {
    tableName.findOne (
        { "_id":  recordID }
    ,function(err, data) {
        if (err) {
            return reject(new Error('getRecord ERROR : ' + err));
        }
        if (!data) {
            return reject(new Error('Record Not Found!'));
        }
        return resolve(data);
    })
})};

let myData = getRecord("bookings", "ABCDE")
</code></pre>

