How to properly have one-to-one relation in MongoDB without any cons?<p>I am working on a project and have these two MongoDB collections, team (holding the details of teams) and payment (holding the payment of the teams) (strictly 1-1 relationship).</p>

<pre><code>Payment Schema
{
    ...
    team: { type: Schema.Types.ObjectId, ref: 'Team', unique: true },
    ...
}
</code></pre>

<p>For Team, I have two alternatives:</p>

<pre><code>Team1 Schema
{
    user_id: { type: Schema.Types.ObjectId, ref: 'User' }
}
</code></pre>

<p>...</p>

<pre><code>Team2 Schema
{
    user_id: { type: Schema.Types.ObjectId, ref: 'User' }
    payment: { type: Schema.Types.ObjectId, ref: 'Payment', unique: true }
}
</code></pre>

<p><strong>NEED:</strong> I have a component "My Teams" where I need to show logged-in user's all teams and his payment status (yes/no).</p>

<p><strong>ISSUE WITH Team1 Schema:</strong> Since I do not have reference to Payment so I need to make another call to backend with team's _id to get Payment object for every team. If a user has 10 teams then it will be 11 backend calls (1 for teams, next 10 for their payment statuses).</p>

<p><strong>ISSUE WITH Team2 Schema:</strong> Since I now have Payment _id inside the Team2 Schema so I can simply check if that field exist or not to determine if it's paid or not. But now the issue is, when a payment is made, I need to update both of Collections and need to use Transactions (to rollback in case any fails) which increases complexity and is also not support unless I have replica sets set upped.</p>

<p>Can you please help me figuring out this the best way possible?</p>

<p>Thanks in advance.</p>

